import React from "react";

function About() {
  return (
    <div style={{ textAlign: "center", marginTop: "100px" }}>
      <h2>About Us</h2>
      <p>
        Bloom Well is an AI-driven platform to promote emotional well-being and
        detect early signs of mental health issues.
      </p>
    </div>
  );
}

export default About;
